import React from "react";
import Chairman from'./Chairman';
import Why from './Why';
import Image from "./Image";
import Footer from "../Footer";
// import {Outlet} from 'react-router-dom';

import './hompage.css';

export default function Homepage()
{
    return(
        <div class = "main">
            <Image/>
            <Chairman />
            <Why/>
            <Footer/>
        </div>
    )
}
